INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("", 107011, 1, 0, "しかし一時には\n赤子同然だった貴方が\nここまで成長したこと……\nとても喜ばしく思います。", 0, 1, 11, 5, 1070501, 1070501043);
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("", 0, "", "", "", "", "", 91, "", 1070501, 1070501044);
